<!DOCTYPE html>
<html lang="en">
    <head>
        <meta charset="UTF-8" />
        <meta name="viewport" content="width=device-width, initial-scale=1.0" />
        <title>Animate SVGs</title>

        <style>
            body {
                min-height: 100vh;
                display: flex;
                flex-direction: column;
                align-items: center;
                justify-content: center;
                margin: 100px 0;
            }

            h1 {
                margin: 50px 0;
            }

            .spin-anim {
                animation: spin 6s linear infinite;
                transform-origin: center;
                transform-box: fill-box;
            }

            .reverse-spin-anim {
                animation: reverse-spin 6s linear infinite;
                transform-origin: center;
                transform-box: fill-box;
            }

            .opacity-anim {
                animation: opacityFlash 3s linear infinite;
            }

            .hovering-anim {
                animation: hovering 5s ease-in-out infinite;
                transform-origin: center;
                transform-box: fill-box;
            }

            .jump-anim {
                animation: jump 1s ease-in-out infinite;
                transform-origin: center;
                transform-box: fill-box;
            }

            .jump-anim-reverse {
                animation: jump-reverse 1s ease-in-out infinite;
                transform-origin: center;
                transform-box: fill-box;
            }

            .plant-anim {
                animation: skew 3s infinite;
                transform: skew;
                animation-direction: alternate;
                transform-origin: bottom;
                transform-box: fill-box;
            }

            .wrist-anim {
                animation: wrist 3s linear infinite;
                transform-origin: center;
                transform-box: fill-box;
            }

            .hand-anim {
                animation: hand 3s linear infinite;
                transform-origin: center;
                transform-box: fill-box;
                transform: translate(-8px, -5px);
            }

            .hand-anim-2 {
                animation: hand 3s linear infinite;
                transform-origin: center;
                transform-box: fill-box;
                transform: translate(8px, -5px);
            }

            .phone-ring-anim {
                -webkit-animation: ring 3s ease infinite;
                animation: ring 3s ease infinite;
                transform-origin: center;
                transform-box: fill-box;
            }

            .at-rotate {
                animation: at-rotate-anim 3s ease infinite;
                transform-origin: center;
                transform-box: fill-box;
            }

            .hand-wave {
                animation: hand-wave-anim 2s ease infinite;
                transform-origin: bottom;
                transform-box: fill-box;
            }

            .cloud-move {
                animation: cloud-anim 5s ease-in-out infinite alternate;
                transform-origin: bottom;
                transform-box: fill-box;
            }

            .cloud-move-accross {
                animation: cloud-move-anim 15s linear infinite;
                transform-origin: bottom;
                transform-box: fill-box;
            }

            .cloud-move-accross-2 {
                animation: cloud-move-anim-2 25s linear infinite;
                transform-origin: bottom;
                transform-box: fill-box;
            }

            .cloud-move-accross-3 {
                animation: cloud-move-anim-3 20s linear infinite;
                transform-origin: bottom;
                transform-box: fill-box;
            }

            .flag-line {
                animation: flag-line-anim 2s infinite alternate;
                transform-origin: bottom;
                transform-box: fill-box;
            }

            .tie-move {
                animation: tie-move-anim 3s ease-in-out infinite alternate;
                transform-origin: top center;
                transform-box: fill-box;
            }

            .rocket-fire {
                animation: rocket-fire-anim 0.8s linear infinite alternate;
                transform-origin: top center;
                transform-box: fill-box;
            }

            .rocket-arrow {
                animation: rocket-arrow-anim 8s infinite alternate;
                transform-origin: bottom;
                transform-box: fill-box;
            }

            .chart-line {
                animation: chart-line-anim 2s infinite alternate;
                transform-origin: bottom;
                transform-box: fill-box;
            }

            .chart-line-2 {
                animation: chart-line-anim-2 2s infinite alternate;
                transform-origin: bottom;
                transform-box: fill-box;
            }

            .search-icon {
                animation: search-icon-anim 2s infinite ease-in-out alternate;
                transform-origin: bottom;
                transform-box: fill-box;
            }

            .heart-anim {
                animation: heartbeat 1s infinite;
                transform-origin: bottom;
                transform-box: fill-box;
            }

            .text-line {
                animation: text-line-anim 2s infinite;
                transform-origin: left;
                transform-box: fill-box;
            }

            .chart-scale {
                animation: chart-scale-anim 3s infinite alternate;
                transform-origin: center;
                transform-box: fill-box;
            }

            .wind-blow {
                animation: rocket-fire-anim 3.5s linear infinite alternate;
                transform-origin: top center;
                transform-box: fill-box;
            }

            .wind-blow-subtle {
                animation: wind-blow-anim 3.5s linear infinite alternate;
                transform-origin: top center;
                transform-box: fill-box;
            }

            .clock-hand {
                animation: clock-hand-rotate 5s linear infinite;
                transform-origin: center;
                transform-box: fill-box;
            }

            .clockHand2 {
                animation: clock-hand-rotate 15s linear infinite;
                transform-origin: bottom;
                transform-box: fill-box;
            }

            .bg-anim {
                animation: bg-anim 15s infinite ease-in-out;
                transform-origin: center;
                transform-box: fill-box;
            }

            @keyframes spin {
                from {
                    rotate: 0;
                }

                to {
                    rotate: 360deg;
                }
            }

            @keyframes reverse-spin {
                from {
                    rotate: 360deg;
                }

                to {
                    rotate: 0deg;
                }
            }

            @keyframes opacityFlash {
                0% {
                    opacity: 1;
                }

                50% {
                    opacity: 0.7;
                }

                100% {
                    opacity: 1;
                }
            }

            @keyframes hovering {
                0% {
                    transform: translate(0, 0);
                }

                50% {
                    transform: translate(20px, 20px);
                }

                100% {
                    transform: translate(0, 0);
                }
            }

            @keyframes jump {
                0% {
                    transform: translate3d(0, 0, 0);
                }

                20% {
                    transform: translate3d(0, 30%, 0);
                }

                50% {
                    transform: translate3d(0, 100%, 0);
                }

                70% {
                    transform: translate3d(0, 30%, 0);
                }

                100% {
                    transform: translate3d(0, 0, 0);
                }
            }

            @keyframes jump-reverse {
                0% {
                    transform: translate3d(0, 0, 0);
                }

                20% {
                    transform: translate3d(0, -20%, 0);
                }

                50% {
                    transform: translate3d(0, -60%, 0);
                }

                70% {
                    transform: translate3d(0, -20%, 0);
                }

                100% {
                    transform: translate3d(0, 0, 0);
                }
            }

            @keyframes skew {
                0% {
                    transform: skewX(8deg) translate(-3px);
                }

                100% {
                    transform: skewX(2deg) translate(3px);
                }
            }

            @keyframes wrist {
                0% {
                    rotate: 0;
                }

                50% {
                    rotate: 10deg;
                }

                100% {
                    rotate: 0;
                }
            }

            @keyframes hand {
                0% {
                    rotate: 0;
                }

                50% {
                    rotate: -8deg;
                }

                100% {
                    rotate: 0;
                }
            }

            @-webkit-keyframes ring {
                0% {
                    -webkit-transform: rotate(-15deg);
                    transform: rotate(-15deg);
                }

                2% {
                    -webkit-transform: rotate(15deg);
                    transform: rotate(15deg);
                }

                4% {
                    -webkit-transform: rotate(-18deg);
                    transform: rotate(-18deg);
                }

                6% {
                    -webkit-transform: rotate(18deg);
                    transform: rotate(18deg);
                }

                8% {
                    -webkit-transform: rotate(-22deg);
                    transform: rotate(-22deg);
                }

                10% {
                    -webkit-transform: rotate(22deg);
                    transform: rotate(22deg);
                }

                12% {
                    -webkit-transform: rotate(-18deg);
                    transform: rotate(-18deg);
                }

                14% {
                    -webkit-transform: rotate(18deg);
                    transform: rotate(18deg);
                }

                16% {
                    -webkit-transform: rotate(-12deg);
                    transform: rotate(-12deg);
                }

                18% {
                    -webkit-transform: rotate(12deg);
                    transform: rotate(12deg);
                }

                20% {
                    -webkit-transform: rotate(0deg);
                    transform: rotate(0deg);
                }
            }

            @keyframes ring {
                0% {
                    -webkit-transform: rotate(-15deg);
                    -ms-transform: rotate(-15deg);
                    transform: rotate(-15deg);
                }

                2% {
                    -webkit-transform: rotate(15deg);
                    -ms-transform: rotate(15deg);
                    transform: rotate(15deg);
                }

                4% {
                    -webkit-transform: rotate(-18deg);
                    -ms-transform: rotate(-18deg);
                    transform: rotate(-18deg);
                }

                6% {
                    -webkit-transform: rotate(18deg);
                    -ms-transform: rotate(18deg);
                    transform: rotate(18deg);
                }

                8% {
                    -webkit-transform: rotate(-22deg);
                    -ms-transform: rotate(-22deg);
                    transform: rotate(-22deg);
                }

                10% {
                    -webkit-transform: rotate(22deg);
                    -ms-transform: rotate(22deg);
                    transform: rotate(22deg);
                }

                12% {
                    -webkit-transform: rotate(-18deg);
                    -ms-transform: rotate(-18deg);
                    transform: rotate(-18deg);
                }

                14% {
                    -webkit-transform: rotate(18deg);
                    -ms-transform: rotate(18deg);
                    transform: rotate(18deg);
                }

                16% {
                    -webkit-transform: rotate(-12deg);
                    -ms-transform: rotate(-12deg);
                    transform: rotate(-12deg);
                }

                18% {
                    -webkit-transform: rotate(12deg);
                    -ms-transform: rotate(12deg);
                    transform: rotate(12deg);
                }

                20% {
                    -webkit-transform: rotate(0deg);
                    -ms-transform: rotate(0deg);
                    transform: rotate(0deg);
                }
            }

            @keyframes at-rotate-anim {
                0% {
                    transform: rotate(0deg);
                }

                25% {
                    transform: rotate(90deg);
                }

                50% {
                    transform: rotate(0deg);
                }
            }

            @keyframes hand-wave-anim {
                0% {
                    transform: rotate(10deg);
                }

                50% {
                    transform: rotate(-10deg);
                }

                100% {
                    transform: rotate(10deg);
                }
            }

            @keyframes cloud-anim {
                0% {
                    transform: translate(0px, 7px);
                }

                50% {
                    transform: translate(0px, -7px);
                }

                100% {
                    transform: translate(0px, 7px);
                }
            }

            @keyframes flag-line-anim {
                0% {
                    transform: scale(1.2);
                }

                50% {
                    transform: scale(0.8);
                }

                100% {
                    transform: scale(1.2);
                }
            }

            @keyframes cloud-move-anim {
                from {
                    transform: translate(-200px, 0);
                }

                to {
                    transform: translate(450px, 0);
                }
            }

            @keyframes cloud-move-anim-2 {
                from {
                    transform: translate(-450px, 0);
                }

                to {
                    transform: translate(220px, 0);
                }
            }

            @keyframes cloud-move-anim-3 {
                from {
                    transform: translate(-450px, 0);
                }

                to {
                    transform: translate(220px, 0);
                }
            }

            @keyframes tie-move-anim {
                from {
                    transform: skewX(10deg);
                }

                to {
                    transform: skewX(-10deg);
                }
            }

            @keyframes rocket-fire-anim {
                0% {
                    transform: rotate(-1deg);
                    -moz-transform: rotate(-1deg);
                    -webkit-transform: rotate(-1deg);
                }

                20% {
                    transform: rotate(1deg);
                    -moz-transform: rotate(1deg);
                    -webkit-transform: rotate(1deg);
                }

                40% {
                    transform: rotate(-1deg);
                    -moz-transform: rotate(-1deg);
                    -webkit-transform: rotate(-1deg);
                }

                60% {
                    transform: rotate(1deg) scaleY(1.04);
                }

                80% {
                    transform: rotate(-2deg) scaleY(0.92);
                    -moz-transform: rotate(-2deg) scaleY(0.92);
                    -webkit-transform: rotate(-2deg) scaleY(0.92);
                }

                100% {
                    transform: rotate(1deg);
                    -webkit-transform: rotate(1deg);
                    -moz-transform: rotate(1deg);
                }
            }

            @keyframes wind-blow-anim {
                0% {
                    transform: rotate(-1deg);
                    -moz-transform: rotate(-1deg);
                    -webkit-transform: rotate(-1deg);
                }

                20% {
                    transform: rotate(1deg);
                    -moz-transform: rotate(1deg);
                    -webkit-transform: rotate(1deg);
                }

                40% {
                    transform: rotate(-1deg);
                    -moz-transform: rotate(-1deg);
                    -webkit-transform: rotate(-1deg);
                }

                60% {
                    transform: rotate(1deg) scaleY(1.04);
                }

                80% {
                    transform: rotate(-2deg) scaleY(0.98);
                    -moz-transform: rotate(-2deg) scaleY(0.98);
                    -webkit-transform: rotate(-2deg) scaleY(0.98);
                }

                100% {
                    transform: rotate(1deg);
                    -webkit-transform: rotate(1deg);
                    -moz-transform: rotate(1deg);
                }
            }

            @keyframes rocket-arrow-anim {
                0% {
                    transform: scale(1);
                }

                50% {
                    transform: scale(0.8);
                }

                100% {
                    transform: scale(1);
                }
            }

            @keyframes chart-line-anim {
                0% {
                    transform: scaleY(1);
                }

                50% {
                    transform: scaleY(0.8);
                }

                100% {
                    transform: scaleY(1);
                }
            }

            @keyframes chart-line-anim-2 {
                0% {
                    transform: scaleY(1.3);
                }

                50% {
                    transform: scaleY(0.8);
                }

                100% {
                    transform: scaleY(1.3);
                }
            }

            @keyframes search-icon-anim {
                0% {
                    transform: rotate(0deg) translateY(10px) rotate(0deg);
                }

                100% {
                    transform: rotate(360deg) translateY(10px) rotate(-360deg);
                }
            }

            @keyframes heartbeat {
                0% {
                    transform: scale(0.75);
                }

                20% {
                    transform: scale(1);
                }

                40% {
                    transform: scale(0.75);
                }

                60% {
                    transform: scale(1);
                }

                80% {
                    transform: scale(0.75);
                }

                100% {
                    transform: scale(0.75);
                }
            }

            @keyframes text-line-anim {
                from {
                    transform: scaleX(0);
                }

                to {
                    transform: scaleX(1);
                }
            }

            @keyframes chart-scale-anim {
                from {
                    transform: scaleX(0.6);
                }

                to {
                    transform: scaleX(1);
                }
            }

            @keyframes clock-hand-rotate {
                from {
                    rotate: 0deg;
                }

                to {
                    rotate: 360deg;
                }
            }

            @keyframes bg-anim {
                0% {
                    transform: rotate(0deg) skew(0 0) scale(1);
                }

                25% {
                    transform: rotate(90deg) skew(10deg, 10deg) scale(0.7);
                }

                50% {
                    transform: rotate(180deg) skew(-3deg, -7deg) scale(0.9);
                }

                75% {
                    transform: rotate(270deg) skew(5deg, 12deg) scale(0.6);
                }

                100% {
                    transform: rotate(360deg) skew(0, 0) scale(1);
                }
            }
        </style>
    </head>
